(14250, 'qing77', 2, 0, 1, 'angel0712', 0, '潘羿晴', '0000-00-00', '', '0961161368', ' 台北市信義區光復南路505號12f之1', 'Hahaha74li@yahoo.com.tw', 'K222811349', '822', '822 中國信託商業銀行　　　　　　　　　　　　', '0037 高雄分行　　　　　　　　　　　　　　　　', '509540250316', '潘羿晴', '烏77', 'https://www.facebook.com/CHIC-x-1994-489873634783339/', 'https://www.facebook.com/profile.php?id=100004759412792', 'https://shopee.tw/yiqingpan', '', '【6/25第一次審核回覆】:這女的是在賣衣服的自己是模特兒，漂亮會拍照', '【6/21第一次審核結果】:版上互動與按讚數極少，是否有其他銷售平台連結網址。或者為何會推薦他，可以大致上說明一下嗎?', '', 0, '', '', '0000-00-00', 0, '2018-06-21 10:53:12', '2020-02-03 10:23:56', '2019-12-30 00:00:00', 0, 0, 0, 0, '', '', '', '', '', '', 0, '', '0000-00-00 00:00:00', 0, 0, '', 0, 0, 0, '', ''),
(14252, 'ab1211', 8, 0, 1, 'angel0712', 0, '高家蓁', '1995-12-11', '', '0935169296', '台中市太平區中山路一段245巷18號5樓之13', 't013014@gmail.com', 'H224421556', '822', '822 中國信託商業銀行　　　　　　　　　　　　', '0026 台中分行　　　　　　　　　　　　　　　　', '026540458154', '高家蓁', 'iamangel.1211', 'https://www.instagram.com/iamangel.1211/', 'https://www.facebook.com/jiajen.kao', 'https://www.instagram.com/iamangel.1211/', '目前是學生兼直播主，可以利用直播期間 小小分享食用產品的心得。', '【6/25第一次審核回覆】:小網美耶~ 回應也不錯呀，他自己吃產品給反饋，沒有粉絲團 ，有個人臉書不過比較少用 ，有經營Ig ，目前也是直播主，我補充直播的好了，因為基本上臉書很少用 ，大多都是以哀居或是直播為主~\r\n好呦謝謝你啦❤️ \r\n我可以說下我的想法就是： \r\n像我們直播主蠻常辦抽獎之類的或是滿多少送什麼禮物 \r\n我覺得可以先把產品當作禮物送 \r\n例如價位少於1000的 都能當作抽獎禮物 \r\n那產品好 那些抽中的吃覺得不錯 極大機率是會詢問直播主下單購買的 加上我覺得這種有益身體健康的 他們吃的好 也會替家人增添購買 \r\n我覺得這種方式可能比較適合我的職業！與其在臉書發文（其實現在臉書觸及率很低很低）倒不如直接用直播偶爾穿插分享和實際給他們體驗過', '【6/21第一次審核結果】:粉絲團附上正確連結；近期FB版上公開文章與互動極少。PS:文章以及好友人數都需設訂公開以便我們審核唷!或者是否有其他銷售平台的網址呢?', '', 0, '', '', '0000-00-00', 0, '2018-06-21 11:10:41', '2020-02-03 09:16:11', '2019-12-30 00:00:00', 0, 0, 0, 0, '', '', '', '', '', '', 0, '', '0000-00-00 00:00:00', 0, 0, '', 0, 0, 0, '', ''),
