(14287, 'ln1688', 8, 0, 1, 'angel0712', 0, '黃琳恩', '0000-00-00', '', '0968006302', '屏東縣東港鎮嘉新二街68號', 'j1998220@gmail.com', 'T224589043', '808', '808 玉山商業銀行　　　　　　　　　　　　　　', '0978 東港分行　　　　　　　　　　　　　　　　', '0978968103277', '黃琳恩', '', '', 'https://www.facebook.com/profile.php?id=100002173060673', 'Ig:https://www.instagram.com/hln.220/   賣場https://shopee.tw/id220/1139275121/', '我z有吃過公司的薑黃錠  很早之前就吃過 當時還沒有很有名就有嘗試過 最近臉書比較沒有在發文 因為臉書也比較少人在看 很多東西分享都會發在ig  我是常常在分享自己覺得好用東西的人 最多就是保健食品、美妝、保養品 所以代言綠金的東西朋友之間觀望率很高 不會覺得是業配文  我個人有在賣膠原蛋白粉/孅后傳減肥藥  都是讓女生變漂亮的東西 。', '【6/26第一次審核回覆】:我有吃過公司的薑黃錠，很早之前就吃過，當時還沒有很有名就有嘗試過，最近臉書比較沒有在發文 \r\n因為臉書也比較少人在看，很多東西分享都會發在ig，我是常常在分享自己覺得好用東西的人，最多就是保健食品、美妝、保養品，所以代言綠金的東西朋友之間觀望率很高，不會覺得是業配文，我個人有在賣膠原蛋白粉/孅后傳減肥藥，都是讓女生變漂亮的東西。\r\n【6/28第二次審核回覆】:我有吃過公司的薑黃錠 \r\n很早之前就吃過 \r\n當時還沒有很有名就有嘗試過 \r\n那時候公司網站也還沒那麼多的產品 \r\n最近臉書比較沒有在發文 \r\n因為臉書也比較少人在看 \r\n很多東西分享都會發在ig \r\n但是我哀居不設定公開 \r\n因為我會過濾人群 \r\n不是假帳號 有頭貼 才會讓他們追蹤 \r\n目前追蹤人數為1220 \r\n我是常常在分享自己覺得好用東西的人 \r\n最多就是保健食品、美妝、保養品 \r\n所以代言綠金的東西朋友之間觀望率很高 不會覺得是業配文 \r\n我個人有在賣膠原蛋白粉/孅后傳減肥藥 \r\n都是讓女生變漂亮的東西 。 \r\n我相信自己幫公司代言產品一定有成績。\r\n\r\n\r\n', '【6/26第一次審核結果】:請附上正確FB網址，PS:文章以及好友人數都需設訂公開以便我們審核唷! 或者可以提供其他社群銷售平台。\r\n【6/27第二次審核結果】:請提供的IG連結網址，設公開以便我們審核唷!', '', 0, '', '', '0000-00-00', 0, '2018-06-25 21:43:28', '2019-11-18 09:37:46', '2018-12-31 00:00:00', 0, 0, 8, 1, '', '', '', '', '', '', 0, '', '0000-00-00 00:00:00', 0, 0, '', 0, 0, 0, '', ''),
